import Tarjetas from "Components/Tarjetas"
import videos from "data/db.json"
import styles from "./"

function Tarjeta() {
<section className={styles.contenedor}>
            {videos.map((video)=>{
                return <Tarjetas {...video} key={video.id}/>
            })}
        </section>
}

export default Tarjeta
